import React from 'react';
import './mainPage.css';

const profiles = [
    { id: 1, name: 'Profile 1', description: 'This is profile 1' },
    { id: 2, name: 'Profile 2', description: 'This is profile 2' },
    { id: 3, name: 'Profile 3', description: 'This is profile 3' }
];

const ProfileCard = ({ profile }) => (
    <div className="profile-card">
        <h2>{profile.name}</h2>
        <p>{profile.description}</p>
        <button>Select</button>
    </div>
);

const MainPage = () => (
    <div className="main-page">
        <h1>Select a Profile</h1>
        <div className="profiles-container">
            {profiles.map(profile => (
                <ProfileCard key={profile.id} profile={profile} />
            ))}
        </div>
    </div>
);

function App() {
    return <MainPage />;
}

export default App;
